import React from "react";
import { Link } from "react-router-dom";
import vendingMachineImage from "./img/vending-machine.jpg";
import "./VendingMachine.css";


export default class VendingMachine extends React.Component {
  render() {
    return (
      <div className="VendingMachine">
        <div className="VendingMachineContainer">
          <h2 className="VendingMachine-header">What would you like to eat?</h2>
          <img
            src={vendingMachineImage}
            alt="Vending Machine"
            className="VendingMachine-image"
          />
          <div className="VendingMachine-container-options">
            <Link to="/soda">Soda</Link>
            <Link to="/chips">Chips</Link>
            <Link to="/candy">Candy</Link>
          </div>
        </div>
      </div>
    );
  }
}
